     SELECT A.*,
            CASE
                WHEN B.AvgPrice IS NULL
                THEN 0
                ELSE 1
            END IsValue,
            B.AvgPrice,
            NULL DiffPrice,
            NULL NewPrice
    -- INTO TruckPaperEquipmentYearGaps
